import { useState } from "react";
import Product from "./Product";
function PropertyExample(){

let [productList,setProductList]=useState([
{
    pname:"Maruthi",
    price:20000
},
{
    pname:"Honda",
    price:40000
},
{
    pname:"Hero",
    price:60000
}
])

    return(
        <>
        <h1>Property Example</h1>
        <Product pname="Maruthi" price="200000"/>
        <Product pname="Honda" price="400000"/>
        <Product pname="Hero" price="600000"/>

{
    productList.map((product,i)=>(
        <Product pname={Product.pname} price={product.price}/>
    ))
}
        </>
    )
}
export default PropertyExample;
